  null,\n\t\"notes\": \"Data Description and Disclaimer rnrnAll Police Reports filed
  by NOPD officers including incident and supplemental reports containing the item
  number, location, disposition, signal, charges, offender race, offender gender,
  offender age, victim age, victim gender, and victim race. Police Reports can be
  updated when subsequent information is determined as a result of an investigation.
  In order to protect the privacy of victims, addresses are shown at the block level.rnrnDisclaimer:
  The New Orleans Police Department does not guarantee (either expressed or implied)
  the accuracy, completeness, timeliness, or correct sequencing of the information.
  The New Orleans Police Department will not be responsible for any error or omission,
  or for the use of, or the results obtained from the use of this information. For
  instance, the data contains ages that may be negative due to data entry errors.
  NOPD has chosen to publish the data as it exists in the source systems for transparency
  and has instituted data validation where appropriate to ensure quality data in the
  future. All data visualizations on maps should be considered approximate and attempts
  to derive specific addresses are strictly prohibited. The New Orleans Police Department
  is not responsible for the content of any off-site pages that are referenced by
  or that reference this web page other than an official City of New Orleans or New
